void rap_get_pipe_fns(struct api_struct **fns, int *n_fns)
{
	*fns = api_rap_cmds;
	*n_fns = sizeof(api_rap_cmds) / sizeof(struct api_struct);
}

NTSTATUS rpc_rap_init(const struct rpc_srv_callbacks *rpc_srv_cb)
{
	return rpc_srv_register(SMB_RPC_INTERFACE_VERSION, "rap", "rap", &ndr_table_rap, api_rap_cmds, sizeof(api_rap_cmds) / sizeof(struct api_struct), rpc_srv_cb);
}

NTSTATUS rpc_rap_shutdown(void)
{
	return rpc_srv_unregister(&ndr_table_rap);
}
